/* code block 2 */import { useState } from 'react';
import {BrowserRouter} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import SignIn from './pages/SignIn';
import Personal from './pages/Personal';


const App = () => {
  const [content, setContent] = useState('home');

  const handleButtonClick = (page) => {
    setContent(page);
  };

  let pageContent;

  switch (content) {
    case 'home':
      pageContent = <Home />;
      break;
    case 'about':
      pageContent = <About />;
      break; 
    case 'signin':
      pageContent = <SignIn />;
      break;
    case 'personal':
      pageContent = <Personal />;
      break;
    default:
      pageContent = <Home />;
      break;
  }

  return (
    <BrowserRouter>
      <div className="container">
        <div className="sidebar">
          <button className="button" onClick={() => handleButtonClick('home')}>Home</button>
          <button className="button" onClick={() => handleButtonClick('about')}>About</button>
          <button className="button" onClick={() => handleButtonClick('signin')}>Sign In</button>
          <button className="button" onClick={() => handleButtonClick('personal')}>Personal</button>
        </div>
        <div className="main">
          {pageContent}
        </div>
      </div>
      <link rel="icon" href="https://fonts.googleapis.com/css2?family=Material+Symbols+Outlined:opsz,wght,FILL,GRAD@20..48,100..700,0..1,-50..200"></link>
    </BrowserRouter>
  );
};


export default App;
